//1358. 包含所有三种字符的子字符串数目
//		给你一个字符串 s ，它只包含三种字符 a, b 和 c 。
//
//		请你返回 a，b 和 c 都 至少 出现过一次的子字符串数目。
//
//
//
//		示例 1：
//
//		输入：s = "abcabc"
//		输出：10
//		解释：包含 a，b 和 c 各至少一次的子字符串为 "abc", "abca", "abcab", "abcabc", "bca", "bcab", "bcabc", "cab", "cabc" 和 "abc" (相同字符串算多次)。
//		示例 2：
//
//		输入：s = "aaacb"
//		输出：3
//		解释：包含 a，b 和 c 各至少一次的子字符串为 "aaacb", "aacb" 和 "acb" 。
//		示例 3：
//
//		输入：s = "abc"
//		输出：1
//
//
//		提示：
//
//		3 <= s.length <= 5 x 10^4
//		s 只包含字符 a，b 和 c 。
public class NumberOfSubstrings_1358 {

	public static void main(String[] args) {
		NumberOfSubstrings_1358 numberOfSubstrings_1358 = new NumberOfSubstrings_1358();
		System.out.println(numberOfSubstrings_1358.numberOfSubstrings(""));
	}

	/**
	 * 53 / 54 个通过测试用例
	 * @param s
	 * @return
	 */
	public int numberOfSubstrings(String s) {
		int len = s.length();
		int reuslt = 0;
		for(int i=0;i<=len-3;i++){
			for(int j=i+3;j<=len;j++){
				String subStr = s.substring(i,j);
				if(subStr.contains("a") && subStr.contains("b") && subStr.contains("c")){
					reuslt += len - j + 1;
					break;
				}
			}
		}
		return reuslt;
	}
}
